import {BrowserRouter, Routes, Route} from 'react-router-dom'
import Login from './pages/Login';
import Chat from './pages/Chat';
function App() {
  const routes = localStorage.token ? <Route path="/" element={<Chat />}/> : <Route path="/login" element={<Login />} />
  return (
    <BrowserRouter>
        <Routes>
          {routes}
        </Routes>
    </BrowserRouter>

  );
}

export default App;
